                                        <li>
                                            <p>Your returns will be calculated on a regular basis.</p>
                                        </li>
                                    </ol>
                                    <h3>How to Refer and Register on BAAP Network:</h3>
                                    <p>To register on the BAAP network, go to the create free account menu and register. If anyone wants to join our network, then that person should have a referral code from an existing member. This is how you refer and register.</p>
                                    <h4>How to Login and Dashboard:</h4>
                                    <p>After registering, the site will send the user ID and Password on the registered mail ID. Go to the login menu on the");
            WriteLiteral(@" homepage, click and fill in the given user ID and Password. <b>After login, you can view it on the left corner  Dashboard tab. </b></p>
                                    <h3>How to Add Fund And Transfer on BAAP Network:</h3>
                                    <p>Click on the manage wallet option in Dashboard, Then click add fund menu. Enter the amount, scan QR and your fund will be added for transferring.</p>
                                    <p>For fund transfer, go on Dashboard to Manage wallet option, and click fund transfer. OTP will be sent to the registered email address. Verify your OTP. Here you can transfer by enrolling your Investor Id through both Dhanu Coin and USDT wallet to any member of BAAP network.</p>
                                    <h4>How to Add Investment on BAAP Network:</h4>
